private static String hex(byte b) {
  StringBuilder strBuilder = new StringBuilder();
  strBuilder.append(HEXES.charAt((b & 0xF0) >> 4)).append(
      HEXES.charAt((b & 0x0F)));
  return strBuilder.toString();
}
